import collections, re
n = int(input())
item_od = collections.OrderedDict()
for i in range(n):
    record_list = re.split(r'(\d+)$',input().strip())
    item_name = record_list[0]
    item_price = int(record_list[1])
    if item_name not in item_od:
        item_od[item_name]=item_price
    else:
        item_od[item_name]=item_od[item_name]+item_price

for i in item_od:
    print((i+str(item_od[i])))

from collections import OrderedDict

def __starting_point():
    num = int(input().strip())
    history = OrderedDict()

    for _ in range(num):
        get_log = input().strip().split()
        good = " ".join(get_log[:-1])
        sold = int(get_log[-1])
        if good not in list(history.keys()):
            history[good] = sold
        else:
            history[good] += sold


    for key in list(history.keys()):
        print(("{} {}".format(key, history[key])))

__starting_point()
